        console.log(token)
        if (token === undefined) {
           
           return <Redirect to='/login' />
        
        }

    }

    render() {
        return (
            <div>
              
            </div>
        )
    }
}

export default withCookies(connect(mapStateToProps)(CheckLoginComponent))
